        MPI_Unpack( buffer, buf_size, &position,
                    &integfochi.chipa_min, 1, MPI_DOUBLE, smpi->getGlobalComm() );
        MPI_Unpack( buffer, buf_size, &position,
                    &integfochi.chipa_max, 1, MPI_DOUBLE, smpi->getGlobalComm() );

        // Resize table before unpacking values
